import React from "react";
// import { useSelector } from "react-redux";
import { Link } from 'react-router-dom';

import './play.scss';

function importAll(r) {
    let images = {};
    r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
    return images;
}

const images = importAll(require.context('../../assets/play', false, /\.(png|jpe?g|svg)$/));

const Play = () => {
    const playlist = Object.keys(images);

    return (
        <div className='play'>
            {playlist.map((image))}
            <Link className='play-thumb'><img src={images['package-1.png']} /></Link>
            <Link className='play-thumb'><img src={images['wesanderson.png']} /></Link>
            <Link className='play-thumb'><img src={images['jam-package.png']} /></Link>
            <Link className='play-thumb'><img src={images['postcard-2101.jpg']} /></Link>
            <Link className='play-thumb'><img src={images['postcard-2102.jpg']} /></Link>
            <Link className='play-thumb'><img src={images['postcard-2103.jpg']} /></Link>
            <Link className='play-thumb'><img src={images['postcard-2104.jpg']} /></Link>
            <Link className='play-thumb'><img src={images['moma-poster.jpg']} /></Link>
            <Link className='play-thumb'><img src={images['playlist.jpg']} /></Link>
        </div>
    );
};

export default Play;
